Reformatted Question: A group of <fact1>190 students</fact1> has various hobbies. <fact2>19 like to paint</fact2>, <fact3>7 like to play football</fact3>, and the rest like to either <fact4>bake or hike</fact4>. How many like to <fact5>bake</fact5> if the number that like to <fact6>hike</fact6> is <fact7>twice the number that prefer playing football</fact7>?

Answer: The number of students that like to paint, play football, and hike is <fact2>19</fact2> + <fact3>7</fact3> + <fact6>x</fact6>, where <fact6>x</fact6> is the number of students that like to hike. Since the total number of students is <fact1>190</fact1>, we have the equation <fact2>19</fact2> + <fact3>7</fact3> + <fact6>x</fact6> = <fact1>190</fact1>. Solving for <fact6>x</fact6>, we get <fact6>x</fact6> = <fact1>190</fact1> - <fact2>19</fact2> - <fact3>7</fact3> = 164. Since the number of students that like to hike is twice the number that prefer playing football, we have <fact6>x</fact6> = 2*<fact3>7</fact3> = 14. However, this is a contradiction since <fact6>x</fact6> cannot be both 14 and 164. This means that our initial assumption that <fact6>x</fact6> is the number of students that like to hike is incorrect. Since <fact7>the number that like to hike is twice the number that prefer playing football</fact7>, let's call the number that prefer playing football <fact8>y</fact8>. Then, the number that like to hike is 2*<fact8>y</fact8>. We can now set up the equation <fact2>19</fact2> + <fact3>y</fact3> + 2*<fact8>y</fact8> = <fact1>190</fact1> and solve for <fact8>y</fact8>. This gives us 3*<fact8>y</fact8> = <fact1>190</fact1> - <fact2>19</fact2> = 171. Therefore, <fact8>y</fact8> = 171/3 = 57. This means that the number of students that like to hike is 2*<fact8>y</fact8> = 2*57 = 114. The number of students that like to bake is then <fact1>190</fact1> - <fact2>19</fact2> - <fact3>7</fact3> - <fact6>114</fact6> = 50.

Answer: {50}
